//所有的这个字符编号从0到127 存储128个 第0位存储该为字符编号 第1位存储频次
        StringBuilder result = new StringBuilder();
        int[][] array = new  int[128][2];
        char[] arrayChar = s.toCharArray();
        //这样子把所有的数组第0位变为了0到127
        for (int i = 0; i <128 ; i++) {
            array[i][0] = i;
        }
        //对应的频次加一
        for (int i = 0; i <arrayChar.length ; i++) {
            array[arrayChar[i]][1] ++;
        }



        //把二维数组一频次排序
        Arrays.sort(array,(i,j)->{
            if (i[1] != j[1]){
                return i[1] - j[1];
            }
            else return  i[0] - j[0];
        });

        for (int i = 127; i >=0 ; i--) {
            int index = 0;
            while (index < array[i][1]){
                result.append((char)array[i][0]);
                index++;
            }
        }
        return result.toString();

